import Link from "next/link";
import Layout from "../components/layout";

const Home = () => {
  return (
    <Layout>
      <div>
        <h1>Welcome to SW4T</h1>
        <Link href="/about">Learn more about SW4T</Link>
      </div>
    </Layout>
  );
};

export default Home;
